function react(input) {
  console.log(input.length);
  let next;
  while(true) {
    next = input.replace(/aA|Aa|bB|Bb|cC|Cc|dD|Dd|eE|Ee|fF|Ff|gG|Gg|hH|Hh|iI|Ii|jJ|Jj|kK|Kk|lL|Ll|mM|Mm|nN|Nn|oO|Oo|pP|Pp|qQ|Qq|rR|Rr|sS|Ss|tT|Tt|uU|Uu|vV|Vv|wW|Ww|xX|Xx|yY|Yy|zZ|Zz/, '');
    if (next === input) {
      break;
    }
    input = next;
  }

  return input.length;
}

const alpha = ['a','b','c','d','e','f','g','h','i','j','k','l','m','n','o','p','q','r','s','t','u','v','w','x','y','z'];

console.log(react(input));

let min = Infinity;
alpha.forEach(letter => {
  const removed = 
    input.replace(new RegExp(letter, ['gi']), '');
  const len = react(removed);
  if(len < min) {
    min = len;
  }
});

console.log(min);
